import React from "react";
const Restaurent = (props) => {
const {restaurent}  =props;
    return (
        <div className="card-columns">
            {
                restaurent.map(rest => (
                <ul>
                    <br></br>
                    <div class="card special">
                      
                    <div class="card-header text-light cardhead">
                      <h4 ><span class="material-icons">
                            location_on
                            </span> {rest.location}</h4>
                    </div>
                    <div class="card-body .cardbg text-center">
                      <h3 class="card-title name">{rest.name}</h3>
                      <p class="card-text">Locality: {rest.area}<br/>
                      Food Types Available:<br/> {rest.foodtype}<br/>
                      Average Cost For Two People: {rest.cost}<br/>
                      Customers Feedback: {rest.feed}<br/>
                      No of Customers voted: {rest.votes}<br/>                
                      
                      
                      </p>
                       <br></br>
                      <a href="#"class="btn btn-primary">Book Now</a>
                    </div>
                  </div>
                  <br></br><br></br>
</ul>
                ))
                
            }

        </div>
      
      
    );
};
export default Restaurent;
